// Classificador inteligente de mensagens
const messageData = $('Extract Message Data').first().json.messageData;
const messageText = (messageData.messageText || messageData.imageCaption || '').toLowerCase().trim();

// Patterns para classifica√ß√£o
const patterns = {
  EXPRESS: [
    // Cumprimentos b√°sicos
    /^(oi|ol√°|hey|e a√≠|salve|bom dia|boa tarde|boa noite)/i,
    /^(como (est√°|vai|anda)|tudo bem|beleza|tranquilo)/i,

    // Confirma√ß√µes simples
    /^(ok|okay|entendi|beleza|show|perfeito|legal|valeu)/i,
    /^(obrigad|brigad|vlw|thanks)/i,

    // Navega√ß√£o/Comandos
    /^(menu|ajuda|help|comandos|in√≠cio|start)/i,
    /^(cancelar|sair|parar|tchau|at√©)/i,

    // Status muito simples
    /^(como estou|status)/i
  ],

  STANDARD: [
    // √Ågua simples
    /^bebi \d+ml/i,
    /^\d+ml de √°gua/i,
    /(√°gua|hidrat)/i,

    // Consultas de resumo
    /^(resumo|como estamos|minhas metas)/i,
    /^(total de hoje|quanto (consumi|bebi))/i,

    // Perguntas educativas simples
    /(posso comer|qual melhor|√© bom|faz mal)/i,
    /(dica|sugest√£o|recomend)/i,
    /(quantas calorias|macro)/i
  ],

  NUTRITION: [
    // Registro de refei√ß√µes
    /(comi|almocei|jantei|lanchei|tomei caf√©)/i,
    /(caf√© da manh√£|almo√ßo|jantar|lanche)/i,

    // Quantidades espec√≠ficas
    /\d+g|\d+ gramas/i,
    /\d+ unidade|\d+ fatia|\d+ colher/i,
    /\d+ml.*[^√°gua]/i, // ml que n√£o seja de √°gua

    // Alimentos espec√≠ficos com detalhes
    /(prote√≠na|carboidrato|caloria|fibra).*\d/i,
    /(arroz|feij√£o|carne|frango|peixe|ovo|p√£o|leite).*\d/i,

    // An√°lises complexas
    /(relat√≥rio|an√°lise completa|feedback|balan√ßo)/i,
    /(d√©ficit|super√°vit|meta di√°ria)/i
  ]
};

// Fun√ß√£o para classificar
function classifyMessage(text, messageData) {
  // Casos especiais priorit√°rios
  if (messageData.hasImage) {
    return 'VISION';
  }

  if (messageData.hasAudio) {
    return 'NUTRITION'; // √Åudio geralmente √© para registrar refei√ß√µes
  }

  // Se mensagem muito curta (< 3 palavras), provavelmente √© EXPRESS
  const wordCount = text.split(/\s+/).length;
  if (wordCount <= 2 && text.length < 15) {
    return 'EXPRESS';
  }

  // Verificar patterns por ordem de prioridade
  for (const [category, patternList] of Object.entries(patterns)) {
    for (const pattern of patternList) {
      if (pattern.test(text)) {
        return category;
      }
    }
  }

  // Heur√≠sticas adicionais

  // Se cont√©m n√∫meros + unidades de medida = NUTRITION
  if (/\d+.*?(g|ml|mg|kg|unidade|fatia|colher|x√≠cara|copo)/i.test(text)) {
    return 'NUTRITION';
  }

  // Se lista v√°rios alimentos = NUTRITION
  const foodWords = text.match(/(arroz|feij√£o|carne|frango|peixe|ovo|p√£o|leite|queijo|presunto|salada|tomate|alface|batata|macarr√£o|massa|suco|caf√©|ch√°)/gi);
  if (foodWords && foodWords.length >= 2) {
    return 'NUTRITION';
  }

  // Se mensagem longa (> 50 chars) e n√£o foi classificada = NUTRITION
  if (text.length > 50) {
    return 'NUTRITION';
  }

  // Default para mensagens m√©dias
  return 'STANDARD';
}

// Classificar a mensagem
const classification = classifyMessage(messageText, messageData);

// Configura√ß√µes por tipo
const config = {
  EXPRESS: {
    queue: 'queue:express',
    model: 'gpt-4o-mini',
    priority: 1,
    timeout: 3000,
    maxRetries: 2,
    estimatedTokens: 150
  },
  STANDARD: {
    queue: 'queue:standard', 
    model: 'gpt-4o-mini',
    priority: 2,
    timeout: 8000,
    maxRetries: 3,
    estimatedTokens: 500
  },
  NUTRITION: {
    queue: 'queue:nutrition',
    model: 'gpt-4o',
    priority: 3,
    timeout: 30000,
    maxRetries: 5,
    estimatedTokens: 2000
  },
  VISION: {
    queue: 'queue:vision',
    model: 'gpt-4o',
    priority: 4,
    timeout: 45000,
    maxRetries: 3,
    estimatedTokens: 3000
  }
};

// Detectar situa√ß√µes especiais
const specialFlags = {
  isGreeting: /^(oi|ol√°|bom dia|boa tarde|boa noite)/i.test(messageText),
  isThankYou: /^(obrigad|brigad|valeu|thanks)/i.test(messageText),
  isQuestion: messageText.includes('?'),
  hasNumbers: /\d/.test(messageText),
  isList: messageText.includes('\n') || (messageText.match(/,/g) || []).length > 2
};

return [{
  json: {
    originalMessage: messageData,
    classification: {
      type: classification,
      confidence: getConfidence(messageText, classification),
      reasoning: getReasoningLog(messageText, classification)
    },
    routing: config[classification],
    analysis: {
      messageLength: messageText.length,
      wordCount: messageText.split(/\s+/).length,
      specialFlags: specialFlags,
      processingTime: new Date().toISOString()
    }
  }
}];

// Fun√ß√£o para calcular confian√ßa na classifica√ß√£o
function getConfidence(text, classification) {
  const wordCount = text.split(/\s+/).length;

  if (classification === 'EXPRESS' && wordCount <= 2) return 0.95;
  if (classification === 'VISION') return 1.0;
  if (classification === 'NUTRITION' && /\d+.*?(g|ml|kg)/i.test(text)) return 0.9;

  return 0.75; // Confian√ßa padr√£o
}

// Log do racioc√≠nio para debug
function getReasoningLog(text, classification) {
  return {
    textLength: text.length,
    wordCount: text.split(/\s+/).length,
    hasNumbers: /\d/.test(text),
    hasUnits: /\d+.*?(g|ml|kg|unidade)/i.test(text),
    classification: classification
  };
}
